window.bookSummaryJSON = "<p>The award-winning author of the best-selling Cork O’Connor series, William Kent Krueger pens novels with pulse-racing suspense. In <i>Windigo Island</i>, the corpse of an Ojibwe girl washes ashore, and locals at the Bad Bluff reservation believe it to be the work of the mythical Windigo. But the dead girl’s friend is also missing, and sheriff-turned-PI Cork O’Connor will brave any danger to bring her home.</p>"; 
